const img: string =
  'data:image/png;base64,';

type Anime = {
  id: string;
  name: string;
  description: string;
  img: string;
  type: string;
  episodes: string;
  status: string;
  genre: string;
  source: string;
  release: string;
  studio: string;
  'MPAA rank': string;
  peggy: string;
  duration: number;
  dubbing: string;
  sameAs: { id: string; name: string; img: string }[];
};

const animes: Anime[] = [];
for (let i = 0; i < 100; i += 1) {
  animes.push({
    id: i.toString(),
    name: `${i}Title`,
    description: `${i}description`,
    img,
    type: `${i}type`,
    episodes: `${i}episodes`,
    status: `${i}status`,
    genre: `${i}genre`,
    source: `${i}source`,
    release: `${i}release`,
    studio: `${i}studio`,
    'MPAA rank': `${i}MPAA rank`,
    peggy: `${i}peggy`,
    duration: i,
    dubbing: `${i}dubbing`,
    sameAs: [
      {
        id: `${1}`,
        name: `${1}name`,
        img,
      },
      { id: `${2}`, name: `${2}name`, img },
      { id: `${3}`, name: `${3}name`, img },
    ],
  });
}
export default animes;
